__all_ = ['ConnectionResults']

class ResultDetails():
    def __init__(self, result_details_dict):
        self.__dict__.update(result_details_dict)


class ConnectionResults():
    def __init__(self, connection_results):
        for result_type, result_details in connection_results.items():
            if result_type in ['codeType', 'americanSubcode', 'nonconformity']:
                self.__dict__.update({result_type : result_details})
            else:
                if result_details:
                    self.__dict__.update({result_type : ResultDetails(result_details)})
                else:
                    self.__dict__.update({result_type : ResultDetails({})})


